import React from 'react';
import {socket} from "../../service/socket";

class ResetWordList extends React.Component {  


  resetWordList = (index) => {
    socket.emit('remove word', index);
  }

  render() {
    return (
      <div>
        <button onClick={() => this.removeWord(index)}>Reset WordList</button>
      </div>
    );
  }
}

export default ResetWordList;
